import { BrowserRouter as Router, Routes, Route, Navigate } from 'react-router-dom';
import Header from './components/Header/Header.jsx';
import Footer from './components/Footer/Footer.jsx';
import About from './components/About/About.jsx';
import Home from './components/Home/Home.jsx';
import Collaborate from './components/Collaborate/Collaborate.jsx'; 
import Contact from './components/Contact/Contact.jsx';
import Gallery from './components/Gallery/Gallery.jsx';
import AuthForm from './components/Login/AuthForm.jsx';
import signup from './components/Signup/Signup.jsx';
import Login from './components/Login/AuthForm.jsx';
import './styles/global.css';
import { useState, useEffect } from 'react';

function App() {
  const [isDarkMode, setIsDarkMode] = useState(localStorage.getItem('theme') === 'dark');
  const [isAuthenticated, setIsAuthenticated] = useState(localStorage.getItem('isAuthenticated') === 'true');

  useEffect(() => {
    // Set body class for light/dark mode
    document.body.className = isDarkMode ? 'dark' : 'light';
    // Save the theme in localStorage
    localStorage.setItem('theme', isDarkMode ? 'dark' : 'light');
  }, [isDarkMode]);

  const toggleDarkMode = () => {
    setIsDarkMode(prevMode => !prevMode);
  };

  // Authentication handler functions
  const handleLogin = (credentials) => {
    // Here you would normally validate credentials with your backend
    console.log('Login attempt with:', credentials);
    
    // For demo purposes, we'll just set authenticated to true
    setIsAuthenticated(true);
    localStorage.setItem('isAuthenticated', 'true');
    return true;
  };

  const handleSignup = (userData) => {
    // Here you would normally send user data to your backend
    console.log('Signup with:', userData);
    
    // For demo purposes, we'll just set authenticated to true
    setIsAuthenticated(true);
    localStorage.setItem('isAuthenticated', 'true');
    return true;
  };

  const handleLogout = () => {
    setIsAuthenticated(false);
    localStorage.removeItem('isAuthenticated');
  };

  return (
    <Router basename="/ArtsApp">
      <Header 
        isDarkMode={isDarkMode} 
        toggleDarkMode={toggleDarkMode} 
        isAuthenticated={isAuthenticated}
        onLogout={handleLogout}
      />

      <main className="container">
        <Routes>
          {/* Auth route */}
          <Route 
            path="/auth" 
            element={
              isAuthenticated ? 
                <Navigate to="/" replace /> : 
                <AuthForm onLogin={handleLogin} onSignup={handleSignup} />
            } 
          />
          
          {/* Default routes */}
          <Route path="/" element={<Home />} />
          <Route path="/home" element={<Home />} />
          <Route path="/about" element={<About />} />
          <Route path="/contact" element={<Contact />} /> 
          <Route path="/Login" element={<Login />} /> 
          <Route path="/signup" element={<AuthForm onSignup={handleSignup} />} /> {/* Signup route */}

          
          {/* Protected routes */}
          <Route 
            path="/collaborate" 
            element={isAuthenticated ? <Collaborate /> : <Navigate to="/auth" replace />} 
          />
          <Route 
            path="/gallery" 
            element={isAuthenticated ? <Gallery /> : <Navigate to="/auth" replace />} 
          />
          
          {/* Wildcard route to catch all undefined paths */}
          <Route path="*" element={<Home />} />
        </Routes>
      </main>

      <Footer />
    </Router>
  );
}

export default App;
